import React from "react";
import { makeStyles, createStyles, Theme } from "@material-ui/core";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      height: "2000px"
    }
  })
);

const Task: React.FC = () => {
  const classes = useStyles();

  return <div className={classes.root}>Task</div>;
};

export default Task;
